function minCapability(nums: number[], k: number): number {
  const n = nums.length;

  /**
   * dp[i][j][0]: 前 i 个元素中，拿 j 个元素，包括 第 j 个的最小窃取能力
   * dp[i][j][1]: 前 i 个元素中，不拿 j 个元素， 不包括 第 j 个的最小窃取能力
   *
   * dp[i][j][0] = Math.max(dp[i-1][j-1][1], nums[j])
   * dp[i][j][1] = Math.max(dp[i-1][j][1], nums[j])
   *
   * dp[i][j] = Math.max(Math.max(dp[i-1][j-1], nums[j]), dp[i-1][j])
   *
   * @type {unknown[]}
   */
  // const dp = Array.from(Array(n),
  //   () => Array(k).fill(Number.MAX_SAFE_INTEGER),
  // );

  /**
   * 只用到了三行，可以节省空间
   */
  let arr1 = Array(k).fill(Number.MAX_SAFE_INTEGER)
  let arr2 = Array(k).fill(Number.MAX_SAFE_INTEGER)
  let arr3 = Array(k).fill(Number.MAX_SAFE_INTEGER)

  for (let i = 0; i < n; i++) {
    for (let j = 0; j < k && j <= (i >> 1); j++) {
      // dp[i][j] = Math.min(
      //   Math.max((i - 2 >= 0 && j - 1 >= 0) ? dp[i - 2][j - 1] : 0
      //     , nums[i])
      //   , i - 1 >= 0 ? dp[i - 1][j] : Number.MAX_SAFE_INTEGER);
      arr3[j] = Math.min(
        Math.max((i - 2 >= 0 && j - 1 >= 0) ? arr1[j - 1] : 0
          , nums[i])
        , i - 1 >= 0 ? arr2[j] : Number.MAX_SAFE_INTEGER);
    }

    arr1 = arr2
    arr2 = arr3
    arr3 = Array(k).fill(Number.MAX_SAFE_INTEGER)
  }

  return arr2[k - 1];
};

